// src/components/Frame4.js
import React from "react";
import { useLocation } from "react-router-dom";

function Frame4() {
  const location = useLocation();
  // Extract the opportunity data from location state (if available)
  const { opportunity } = location.state || {};

  return (
    <div className="frame4" style={{ marginTop: "-70px" }}>
      <div className="textArbitrageFound">Arbitrage Opportunity Found:</div>

      {opportunity ? (
        <div>
          <div>
            <strong>Event:</strong> {opportunity.event}
          </div>
          <div>
            <strong>Profit Margin:</strong> {opportunity.profit_margin}%
          </div>
          <div>
            <strong>Total Profit:</strong> ${opportunity.total_profit}
          </div>
          <div>
            <strong>Bookmakers:</strong> {opportunity.home_book} (home) vs{" "}
            {opportunity.away_book} (away)
          </div>
          {/* You can add more details as needed */}
        </div>
      ) : (
        <p>No arbitrage opportunity data received.</p>
      )}

      {/* Existing structure */}


      <div className="line2"></div>
    </div>
  );
}

export default Frame4;
